import React from 'react';
import images from "./imgs.js";
import Card from "./Card.jsx";
import "./index.css";

function createcard(props)
{
  return(
    <div key={props.id}>
      <Card  val={props.pic}/>
    </div>
  );
}

function App() {
  return (
    <div >
      {images.map(createcard)}
      <img className="pic" scr="./images/road.jpg" alt="pic_img"/>

      {
        images && images.map((item)=>
        <div key={item.id}>
            <img src={item.pic} className='pic' alt="error"/>
        </div>
        )
      }
    </div>
  );
}

export default App;
